  Curriculou
      </div>
      <div className='flex flex-row'>
        <div className='flex flex-col w-[50%] left-0 bg-gray-200'>
          <div className='text-3xl'>Crie agora o seu Curriculo de maneira simples e rápida!</div>
          <button className='w-96 h-14 rounded-full bg-[#669FD6]'>Selecionar o Modelo</button>
        </div>
        <div><img src="./vetor.jpg" className='w-[65%]'></img></div>
      </div>
    </div>
  );
}

export default App;
